import React from "react";
import PropTypes from "prop-types";
import NewsGrid from "../../containers/Home/NewsGrid";

function DarkEditorPackSection({ editorPackSectionDatas }) {
  // Handle missing or undefined data gracefully
  if (!editorPackSectionDatas || Object.keys(editorPackSectionDatas).length === 0) {
    return <div>No data available</div>; // Render a fallback if no data is provided
  }

  return (
    <section className="codex-er-editors-pack-white-area codex-er-editors-pack-dark-area">
      <div className="container">
        <div className="row">
          <div className="col-lg-12">
            <div className="codex-er-editors-pack-title d-flex justify-content-between align-items-center">
              <h4 className="codex-er-title">Trending Articles</h4>
            </div>
          </div>
        </div>

        <div className="row g-0 align-items-center">
          <div className="col-lg-9">
            <div className="codex-er-editors-pack-thumb">
              {/* Ensure that the image URL exists before rendering */}
              {editorPackSectionDatas.image && (
                <img src={editorPackSectionDatas.image} alt="Editor Pack Thumbnail" />
              )}
            </div>
          </div>
          <div className="col-lg-3">
            <div className="codex-er-editors-pack-content">
              <div className="codex-er-meta-item">
                <div className="codex-er-meta-categories">
                  {/* Make category dynamic */}
                  <a href="#">{editorPackSectionDatas.category || "General"}</a>
                </div>
                <div className="codex-er-meta-date">
                  <span>
                    <i className="fal fa-calendar-alt"></i> {editorPackSectionDatas.date}
                  </span>
                </div>
              </div>
              <h4 className="codex-er-title">
                <a href="#">{editorPackSectionDatas.title}</a>
              </h4>
              <div className="codex-er-meta-author">
                <div className="codex-er-author">
                  {/* Ensure the author image path is correct */}
                  <img src={editorPackSectionDatas.authorImage || "assets/images/user-2.png"} alt="Author" />
                  <span>
                    By <span>{editorPackSectionDatas.user || "Unknown"}</span>
                  </span>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div className="codex-er-editors-pack-item mt-60">
          {/* Pass the data to NewsGrid */}
          <NewsGrid editorPackSectionDatas={editorPackSectionDatas} />
        </div>
      </div>
    </section>
  );
}

// Prop validation to ensure data is passed correctly
DarkEditorPackSection.propTypes = {
  editorPackSectionDatas: PropTypes.shape({
    image: PropTypes.string,
    category: PropTypes.string,
    date: PropTypes.string,
    title: PropTypes.string,
    user: PropTypes.string,
    authorImage: PropTypes.string,
  }),
};

// Default props in case data is missing
DarkEditorPackSection.defaultProps = {
  editorPackSectionDatas: {},
};

export default DarkEditorPackSection;




